def lambda_handler(event, context):
    sc_obj = script_object(event)
    lambda_response = sc_obj.starter()
    logger.info(f'respuesta final de lambda: \n{lambda_response}')
    return lambda_response
    

class script_object(builder_class):
    def __init__(self, event):
        
        try:
            self.failed_init = False
            self.final_response = {'headers':{'Access-Control-Allow-Headers': '*', 
                                               'Access-Control-Allow-Origin': '*', 
                                              'Access-Control-Allow-Methods': '*'}, "statusCode": 500, 'body': {}}
            self.db_connection = 0
            self.detailed_raise = ''
            self.partial_response = {}
            
            logger.info('[__INIT__] Inicializando Lambda ...')
            logger.warning(f'event de entrada: {str(event)}')

            event_body_json = event["body"]
            self.event_body_dict = json.loads(event_body_json)

            self.id_assessment = self.event_body_dict['id_assessment']
            self.first_time_classification = True if 'selected_dates' in self.event_body_dict else False

            self.classification_dates = set(item['date'] for item in self.event_body_dict['data'])
            
            self.company_data = dict()
            self.current_archive_data = dict()
            self.archives_dates = list()
            self.full_historic_data = list()

            self.raw_classification_data = pd.core.frame.DataFrame()
            self.reduced_classified_df = pd.core.frame.DataFrame()
            self.merged_df = pd.core.frame.DataFrame()
            self.selected_archives_to_db_df = pd.core.frame.DataFrame()
            

            logger.info('[__INIT__] Objeto lambda inicializada exitosamente')
            
        except Exception as e:
            self.failed_init = True
            logger.error(f"[__INIT__] error en inicializacion, linea: {get_current_error_line()}, motivo: "+str(e)) 

    @timing
    def starter(self):
        try:
            if self.failed_init:
                raise AttributeError('Error con los datos recibidos al servicio')
            
            self.create_conection_to_db()
            #self.db_connection.begin()
            self.get_company_archive_info()
            self.user_classification_data_safe_delete()

            self.choose_clasification_data()

            self.get_classification_raw_info()
            
            ##Manejo de clasificaciones actuales
            self.reduce_classified()
            self.merge_classifications()
            self.depurate_classifies_to_bd()
            self.user_classified_to_bd()    

            #Clasificando los pucs actuales
            self.get_original_puc_data()
            self.balance_pucs_accounts()
            self.re_classify_all_historic_pucs()
            self.historic_pucs_builder()

            self.save_assessment_step()
            call_dynamic_engine(self.id_assessment)
            #self.db_connection.commit()
            return self.response_maker(succesfull_run = True)
        except Exception as e:
            if self.db_connection:
                self.db_connection.close()
            logger.error(f'[starter] Hubieron problemas en el comando de la linea: {get_current_error_line()}')
            return self.response_maker(succesfull_run = False, error_str = (str(e)))


    @handler_wrapper('Creando conexion a bd','Conexion a bd creada con exito','Error en la conexion a bd','Problemas creando la conexion a bd')
    def create_conection_to_db(self):
        if __name__ != 'lambda_function':
            self.db_connection = connect_to_db_local_dev()
            self.db_connection.begin()
            return
        db_schema = os.environ['DB_SCHEMA']
        secret_db_region = os.environ['SECRET_DB_REGION']
        secret_db_name = os.environ['SECRET_DB_NAME']
        db_secret = get_secret(secret_db_region, secret_db_name)
        self.db_connection = connect_to_db(db_schema, db_secret)

    @handler_wrapper('El proceso requirió la eliminacion de una clasificacion anterior','Borrado seguro realizado con exito','Error realizando el borrado seguro de clasificacion de usuario anterior','Problemas sobre escribiendo una clasificacion anterior')
    def user_classification_data_safe_delete(self):
        query = f"DELETE FROM USER_CLASSIFICATION WHERE ID_ASSESSMENT = {self.id_assessment}"
        logger.info(f'[user_classification_data_safe_delete] Query para eliminar datos anteriores de clasificacion personal: {query}')
        self.db_connection.execute(text(query))
        
        query = f"DELETE FROM CLASSIFICATION_SUMMARY WHERE ID_ASSESSMENT = {self.id_assessment}"
        logger.info(f'[user_classification_data_safe_delete] Query para eliminar datos anteriores de resultados por clasificacion: {query}')
        self.db_connection.execute(text(query))
            
        query = f"DELETE FROM ASSESSMENT_CHECKED WHERE ID_ASSESSMENT = {self.id_assessment}"
        logger.info(f'[user_classification_data_safe_delete] Query para eliminar datos anteriores de items purgados: {query}')
        self.db_connection.execute(text(query))
        

    @handler_wrapper('Buscando info de empresa y archive a valorar', 'Información de empresa y archive obtenida', 'Error obteniendo información de empresa y archive', 'Error adquiriendo información del proceso de información')
    def get_company_archive_info(self):
        query = f"""SELECT A.ID, B.INITIAL_DATE FROM COMPANY A, ARCHIVE B, ASSESSMENT C WHERE A.ID = B.ID_COMPANY AND B.ID = C.ID_ARCHIVE AND C.ID = {self.id_assessment}"""
        logger.info(f'[get_company_archive_info] Query para pedir la información del assessment:\n{query}')
        rds_data = self.db_connection.execute(text(query))
        assessment_data = rds_data.one()._asdict()
        self.id_company = assessment_data['ID']
        self.classification_dates.add(assessment_data['INITIAL_DATE'].strftime('%Y-%m-%d'))


    @handler_wrapper('Decidiendo el array de clasificaciones', 'Array de clasificaciones legido con exito', 'Error escogiendo array de clasificaciones', 'Porblemas procesando multiples fechas d clasificaciones')
    def choose_clasification_data(self):
        all_got_dates = [datetime.datetime.strptime(date, '%Y-%m-%d') for date in self.classification_dates]
        max_date_str = max(all_got_dates).strftime('%Y-%m-%d')
        last_date_data = next(item['data'] for item in self.event_body_dict['data'] if item['date'] == max_date_str)
        self.raw_classified_df = pd.DataFrame.from_records( last_date_data )

        
    @handler_wrapper('Buscando datos de clasificacion raw para realizar el merge de los datos clasificados','Datos de clasificaciones raw obtenidos con exito','Error buscando clasificaciones raw','Error emergiendo la data recibida de clasificaciones')
    def get_classification_raw_info(self):
        query = "SELECT ID, CLASSIFICATION FROM RAW_CLASSIFICATION"
        logger.info(f'[get_classification_raw_info] Query para obtener las clasificaciones raw: {query}')
        self.raw_classification_data = pd.read_sql(query, self.db_connection)
        self.classification_id_dict = dict(zip(self.raw_classification_data.CLASSIFICATION, self.raw_classification_data.ID))
        self.id_classification_dict = dict(zip(self.raw_classification_data.ID, self.raw_classification_data.CLASSIFICATION))
        
    
    @handler_wrapper('Recortando clasificaciones innecesarias','Clasificaciones innecesarias depuradas con exito','Error al depurar df clasificado','Error fatal en la revision de la clasificacion')
    def reduce_classified(self):
        logger.warning(f'[reduce_classified] DF que voy a depurar: \n{self.raw_classified_df.head(5).to_string()}')
        self.raw_classified_df.drop(['chapter', 'initial_date'], axis=1, inplace=True) #'index',
        self.levels = sorted(self.raw_classified_df['nivel'].unique().tolist()) #este va aumentando 1,2,4,6
        self.reduced_classified_df = self.raw_classified_df.loc[self.raw_classified_df['nivel'] == self.levels[1]]
        for level in self.levels[2:]:
            [self.account_depurator_chooser(account) for account in self.raw_classified_df.loc[self.raw_classified_df['nivel']==level].to_dict(orient='records')]

        logger.warning(f"[reduce_classified] resultado de depurador:\n {self.reduced_classified_df.to_dict(orient='records')}")
        logger.warning(f"[reduce_classified] con una longitud de:\n {self.reduced_classified_df.shape[0]}")


    @debugger_wrapper('Error reduciendo datafram', 'Error reduciendo cuentas')
    def account_depurator_chooser(self,account):
        account_classification = account["classification"]
        account_parents_list = [account['account'][:nivel] for nivel in self.levels]
        temp_parent_classification = self.reduced_classified_df.loc[self.reduced_classified_df['account'].isin(account_parents_list)]
        parent_classification = temp_parent_classification.loc[temp_parent_classification['nivel'] == temp_parent_classification['nivel'].max(), 'classification'].values[0]

        if account_classification != parent_classification:
            self.reduced_classified_df = pd.concat([self.reduced_classified_df, self.raw_classified_df.loc[self.raw_classified_df['account'].str.fullmatch(account['account'])]])


    @handler_wrapper('Realizando merge de clasificacion para obtener los ids de clasificacion','Merge realizado con exito','Error realizando merge de clasificacion default con la tabla de nombre raw de clasificacion','Hubieron problemas con los datos recibidos')
    def merge_classifications(self):
        """Acá se está asignando los ids de clasificacion al dataframe clasificado reducido
        """
        self.merged_df = self.reduced_classified_df.merge(self.raw_classification_data, how='inner',left_on = ['classification'], right_on = ['CLASSIFICATION'])


    @handler_wrapper('Depurando dataframe para envio a base de datos','Depurado a base de datos terminado con exito','Error en la depuracion a base de datos','Error arreglando datos para guardar en base de datos')
    def depurate_classifies_to_bd(self):
        #acá llega con estas columnas nivel, classification, account,  ID, CLASSIFICATION
        logger.warning(f'informacion que llega a depuracion:\n{self.merged_df.head(5).to_string()}')
        self.merged_to_db_df = self.merged_df.copy()
        self.merged_to_db_df.drop(['nivel', 'classification', 'CLASSIFICATION', 'status', 'ID_RAW_CLASSIFICATION', 'balance', 'name'], axis=1, inplace = True, errors= 'ignore')
        self.merged_to_db_df['ID_ASSESSMENT'] = self.id_assessment
        self.merged_to_db_df.rename(columns={"account": "ACCOUNT_NUMBER", 'ID': 'ID_RAW_CLASSIFICATION'}, inplace = True)
        self.merged_to_db_df.sort_values(by=['ACCOUNT_NUMBER'], inplace = True, ignore_index = True)
    
    
    @handler_wrapper('Cargando clasificacion del analista a base de datos', 'Clasificacion del analista guardada con exito','Error al guardar clasificacion del analista en bd','Hubieron errores al guardar clasificacion del analista en base de datos')
    def user_classified_to_bd(self):
        logger.info(f'[user_classified_to_bd] Datos que se van a guardar en bd:\n{self.merged_to_db_df.to_string()}')
        self.merged_to_db_df.to_sql(name='USER_CLASSIFICATION', con=self.db_connection, if_exists='append', index=False)


    @try_pass_wrapper('Puede que el paso del proceso ed valoración ya exista')
    def save_assessment_step(self):
        query = f"INSERT INTO ASSESSMENT_STEPS VALUES ({self.id_assessment}, \"CLASSIFICATION\");"
        logger.info(f"[save_assessment_step] Query a base de datos para guardar el paso del proceso de valoracion: \n{query}")
        self.db_connection.execute(text(query))


    @handler_wrapper('Obteniendo datos de puc historicos originales', 'Datos de puc originales obtenidos con exito', 'Error obteniendo datos de puc historicos', 'Error obteniendo datos de pucs historicos')
    def get_original_puc_data(self):
        classification_dates_str = str(self.classification_dates).replace('{','').replace('}','')
        query = f"""SELECT C.ID_ARCHIVE, C.ACCOUNT_NUMBER, C.CHECKED_BALANCE AS value, C.ACCOUNT_NAME FROM COMPANY A, ARCHIVE B, ORIGINAL_PUC C WHERE A.ID = B.ID_COMPANY AND B.ID = C.ID_ARCHIVE AND B.INITIAL_DATE IN ({classification_dates_str}) AND A.ID = {self.id_company}"""
        logger.info(f'[get_company_archive_info] Query para pedir la información del assessment:\n{query}')
        rds_data = self.db_connection.execute(text(query))
        self.full_historic_data = [row._asdict() for row in rds_data.fetchall()]
        for row in self.full_historic_data:
            row['value'] = float(row['value'])
            row['nivel'] = len(row['ACCOUNT_NUMBER'])


    @handler_wrapper('Balanceando numeros de cuentas entre pucs historicos', 'Balanceado de pucs historics exitoso', 'Error balanceando cuentas de pucs historicos', 'Error construyendo cuentas para balanceado de pucs historicos')
    def balance_pucs_accounts(self):
        assessment_id_archives = set(row['ID_ARCHIVE'] for row in self.full_historic_data)
        archives_accounts_directory = {archive: list() for archive in assessment_id_archives}
        all_historic_account_numbers = set()
        for row in self.full_historic_data:
            all_historic_account_numbers.add(row['ACCOUNT_NUMBER'])
            archives_accounts_directory[row['ID_ARCHIVE']].append(row['ACCOUNT_NUMBER'])
        for archive, this_archive_accounts in archives_accounts_directory.items():
            this_archive_missing_accounts = [item for item in all_historic_account_numbers if item not in this_archive_accounts]
            logger.warning(f'[balance_pucs_accounts] al archive {archive} le hacen falta las cuentas {this_archive_missing_accounts}')
            for account_number in this_archive_missing_accounts:
                self.full_historic_data.append({'ACCOUNT_NUMBER': account_number, 'ACCOUNT_NAME': 'Cuenta creada para balanceo de pucs historicos', 'value': 0, 'ID_ARCHIVE': archive, 'nivel': len(account_number)})
                #Estas cuentas que se van a crear para equilibrio, no requieren estar clasificadas, porque serán clasificadas por el merge de clasificacion de todas formas

    @handler_wrapper('Clasificando los pucs historicos totales', 'Pucs historicos clasificados con exito', 'Error clasificando pucs historicos', 'Error clasificando historicos con clasificaciones de usuario')
    def re_classify_all_historic_pucs(self):
        for merged_item in self.merged_to_db_df.to_dict(orient = 'records'):
            filtered_items = [row for row in self.full_historic_data if row['ACCOUNT_NUMBER'].startswith(merged_item['ACCOUNT_NUMBER'])]
            for row in filtered_items:
                row['classification'] = self.id_classification_dict[merged_item['ID_RAW_CLASSIFICATION']]
                


    def response_maker(self, succesfull_run = False, error_str = str):
        if succesfull_run:
            self.final_response['statusCode'] = 200
            self.final_response['body'] = json.dumps('ok')
            self.db_connection.commit() if __name__ != 'lambda_function' else None

        else:
            self.final_response['body'] = json.dumps(self.detailed_raise if self.detailed_raise else error_str)
            self.db_connection.rollback() if self.db_connection and __name__ != 'lambda_function' else None

        if self.db_connection:
            self.db_connection.close()
        return self.final_response


